package operators;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    int a=20,b=10;
    System.out.println("equal to opr is:"+(a==b));
    System.out.println("not equal to opr is:"+(a!=b));
    System.out.println("greater than  opr is:"+(a>b));
    System.out.println("less than opr is:"+(a<b));
    System.out.println("greater than equal to opr is:"+(a>=b));
    System.out.println("less than equal to opr is:"+(a<=b));
		
		
		
	}

}
